import { Grid } from "@mui/material";
import React from "react";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";
import { useDispatch } from "react-redux";
import { useSelector } from "react-redux";
import { moveTask, reorderTasks } from "../../Reducers/DayReducer";

const DayDragDrop = () => {
    const dispatch = useDispatch();
    const incompleteTasks = useSelector(state => state.dayReducer.incompleteTasks)
    const activeTasks = useSelector(state => state.dayReducer.activeTasks)
    const finishedTasks = useSelector(state => state.dayReducer.finishedTasks)

    const onDragEnd = (result) => {
        const { source, destination } = result;

        if (!destination) {
            return
        }

        if (source.droppableId == destination.droppableId && source.index != destination.index) {
            switch (source.droppableId) {
                case 'incomplete':
                    dispatch(reorderTasks({source, destination, start: 'incompleteTasks', end: 'activeTasks'}))
                    break;
                case 'active':
                    dispatch(reorderTasks({source, destination, start: 'activeTasks', end: 'incompleteTasks'}))
                    break;
                case 'finished':
                    dispatch(reorderTasks({source, destination, start: 'finishedTasks', end: 'incompleteTasks'}))
                    break; 
            }
        } else {
            switch (source.droppableId) {
                case 'incomplete':
                    if (destination.droppableId == 'active')
                        dispatch(moveTask({source, destination, start: 'incompleteTasks', end: 'activeTasks'}))
                    if ((destination.droppableId == 'finished'))
                        dispatch(moveTask({source, destination, start: 'incompleteTasks', end: 'finishedTasks'}))
                    break;
                case 'active':
                    if (destination.droppableId == 'incomplete')
                        dispatch(moveTask({source, destination, start: 'activeTasks', end: 'incompleteTasks'}))
                    if ((destination.droppableId == 'finished'))
                        dispatch(moveTask({source, destination, start: 'activeTasks', end: 'finishedTasks'}))
                    break;
                case 'finished':
                    if (destination.droppableId == 'incomplete')
                        dispatch(moveTask({source, destination, start: 'finishedTasks', end: 'incompleteTasks'}))
                    if ((destination.droppableId == 'active'))
                        dispatch(moveTask({source, destination, start: 'finishedTasks', end: 'activeTasks'}))
                    break; 
            }
        }
    };

    return (
        <DragDropContext onDragEnd={onDragEnd}>
            <Grid container columnGap={8} rowGap={2} marginTop={'1em'} justifyContent={'center'}>
                <Grid item xs={3.33} marginLeft={'1em'} fontSize={35}>
                    Not Started
                </Grid>
                <Grid item xs={3.33} fontSize={35}>
                    In Progress
                </Grid>
                <Grid item xs={3.33} fontSize={35}>
                    Completed
                </Grid>
                <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'} minHeight={500}>
                    <Droppable droppableId="incomplete">
                        {(provided) => (
                        <ul
                            {...provided.droppableProps}
                            ref={provided.innerRef}
                            style={{
                                listStyleType: 'none',
                                padding: '8px',
                                margin: '8px',
                                minHeight:'200px'
                            }}
                        >
                            {incompleteTasks.map((item, index) => (
                                    <Draggable key={item.id} draggableId={String(item.id)} index={index}>
                                        {(provided, snapshot) => (
                                            <div
                                                ref={provided.innerRef}
                                                {...provided.draggableProps}
                                                {...provided.dragHandleProps}
                                            >
                                                {item.titleFieldValue}
                                            </div>
                                        )}
                                    </Draggable>
                                ))}
                            {provided.placeholder}
                        </ul>
                        )}
                    </Droppable>
                </Grid>
                <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>
                    <Droppable droppableId="active">
                        {(provided) => (
                        <ul
                            {...provided.droppableProps}
                            ref={provided.innerRef}
                            style={{
                                listStyleType: 'none',
                                padding: '8px',
                                margin: '8px',
                                minHeight:'200px'
                            }}
                        >
                            {activeTasks.map((item, index) => (
                                    <Draggable key={item.id} draggableId={String(item.id)} index={index}>
                                        {(provided, snapshot) => (
                                            <div
                                                ref={provided.innerRef}
                                                {...provided.draggableProps}
                                                {...provided.dragHandleProps}
                                            >
                                                {item.titleFieldValue}
                                            </div>
                                        )}
                                    </Draggable>
                                ))}
                            {provided.placeholder}
                        </ul>
                        )}
                    </Droppable>
                </Grid>
                <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>
                    <Droppable droppableId="finished">
                        {(provided) => (
                        <ul
                            {...provided.droppableProps}
                            ref={provided.innerRef}
                            style={{
                                listStyleType: 'none',
                                padding: '8px',
                                margin: '8px',
                                minHeight:'200px'
                            }}
                        >
                            {finishedTasks.map((item, index) => (
                                    <Draggable key={item.id} draggableId={String(item.id)} index={index}>
                                        {(provided, snapshot) => (
                                            <div
                                                ref={provided.innerRef}
                                                {...provided.draggableProps}
                                                {...provided.dragHandleProps}
                                            >
                                                {item.titleFieldValue}
                                            </div>
                                        )}
                                    </Draggable>
                                ))}
                            {provided.placeholder}
                        </ul>
                        )}
                    </Droppable>
                </Grid>
            </Grid>
        </DragDropContext>
    )
}

export default DayDragDrop;
